class Solution(object):
    def maxVowels(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        
        def isVowel(ch):
            if ch in 'aeiou':
                return True
            else:
                return False

        length = len(s)
        maxVowel = 0
        for i in range(length-k+1):
            currWord = s[i:i+k]
            currVowel = 0
            ###print "currWord is %s" % currWord
            for j in range(k):
                if isVowel(currWord[j]):
                    currVowel += 1
                if currVowel == k:
                    return k
            if currVowel > maxVowel:
                maxVowel = currVowel
        return maxVowel
    
